import React from 'react';

const TempUnit = ({ celsiusChecked, fahrenheitChecked, onUnitChanged }) => {

    return (
        <td>
            <table className="ui two very basic column table">
                <tbody>
                    <tr>
                        <td>
                            <input
                                type="radio"
                                checked={celsiusChecked}
                            />
                            <label>'C</label>
                        </td >
                        <td>
                            <input
                                type="radio"
                                checked={fahrenheitChecked}
                            />
                            <label>'F</label>
                        </td>
                    </tr>
                </tbody>
            </table >
        </td>
    );
};

export default TempUnit;
